import Vue from "vue";
import VueRouter from "vue-router";
import tabLayout from '@components/layoutManage/tabLayout'
import baseLayout from '@components/layoutManage/baseLayout'
// let _import = null
// if (process.env.NODE_ENV === 'development') {
//   _import = file => require('@/views/' + file + '.vue').default
// } else {
//   _import = file => () => import('@/views/' + file + '.vue')
//   // _import = file => require('@/views/' + file + '.vue').default
// }

Vue.use(VueRouter);

const routes = [
  {
    path: "/",
    name: "entrance",
    // component: _import('entrance/entrance'),
    component: () => import('@/views/entrance/entrance.vue'),

    meta: { 
      title: 'i我家'
    }
  },
  {
    path: '/index',
    component: tabLayout,
    children: [
      {
        path: '/index/home',
        name: 'home',
        desc: '首页',
        // component: _import('home/home'),
        component: () => import('@/views/home/home.vue'),
        meta:{
          title:'i我家',
          keepAlive: true
        }
      },
      {
        path: '/index/center',
        name: 'center',
        desc: '个人中心',
        // component: _import('center/center'),
        component: () => import('@/views/center/center.vue'),

        meta:{
          title:'个人中心',
        }
      }
    ]
  },
  {
    path: '/home',
    // component: {render: (e) => e("router-view")}, // 嵌套路由中无父级组件的设置方法
    component: baseLayout,
    children: [
      {
        path: '/home/search',
        name: 'search',
        desc: '搜索',
        // component: _import('home/search'),
        component: () => import('@/views/home/search.vue'),

        meta:{
          title:'i我家'
        }
      },
    ]
  },
  {
    path: '/center',
    component: baseLayout,
    children: [
      {
        path: '/center/joinVip',
        name: 'joinVip',
        desc: '开通会员',
        // component: _import('center/joinVip'),
        component: () => import('@/views/center/joinVip.vue'),

        meta:{
          title:'i我家'
        }
      },
      {
        path: '/center/protocol',
        name: 'protocol',
        desc: '协议',
        // component: _import('center/protocol'),
        component: () => import('@/views/center/protocol.vue'),

        meta:{
          title:'i我家'
        }
      },
      {
        path: '/center/redPacket',
        name: 'redPacket',
        desc: '红包',
        // component: _import('center/redPacket'),
        component: () => import('@/views/center/redPacket.vue'),

        meta:{
          title:'红包'
        }
      },
    ]
  },
  {
    path: '/shop',
    component: baseLayout,
    children: [
      {
        path: '/shop/shopDetail',
        name: 'shopDetail',
        desc: '店铺详情',
        // component: _import('shop/shopDetail'),
        component: () => import('@/views/shop/shopDetail.vue'),

        meta:{
          title:'店铺详情'
        }
      },
      {
        path: '/shop/applyShop',
        name: 'applyShop',
        desc: '适用店铺',
        // component: _import('shop/applyShop'),
        component: () => import('@/views/shop/applyShop.vue'),

        meta:{
          title:'适用店铺'
        }
      },
      {
        path: '/shop/applyAddressShop',
        name: 'applyAddressShop',
        desc: '适用门店',
        // component: _import('shop/applyAddressShop'),
        component: () => import('@/views/shop/applyAddressShop.vue'),

        meta:{
          title:'适用门店'
        }
      },
    ]
  },
  {
    path: '/coupon',
    component: baseLayout,
    children: [
      {
        path: '/coupon/couponList',
        name: 'couponList',
        desc: '我的卡券',
        // component: _import('coupon/couponList'),
        component: () => import('@/views/coupon/couponList.vue'),

        meta:{
          title:'我的卡券'
        }
      },
      {
        path: '/coupon/couponDetail',
        name: 'couponDetail',
        desc: '卡券详情',
        // component: _import('coupon/couponDetail'),
        component: () => import('@/views/coupon/couponDetail.vue'),

        meta:{
          title:'卡券详情'
        }
      },
      {
        path: '/coupon/travelCardDetails',
        name: 'travelCardDetails',
        desc: '自我游卡券详情',
        // component: _import('coupon/travelCardDetails'),
        component: () => import('@/views/coupon/travelCardDetails.vue'),

        meta:{
          title:'卡券详情'
        }
      },

    ]
  },
  {
    path: '/active',
    component: baseLayout,
    children: [
      {
        path: '/active/specialSale',
        name: 'specialSale',
        desc: '特卖活动',
        // component: _import('active/specialSale'),
        component: () => import('@/views/active/specialSale.vue'),

        meta:{
          title:'i我家',
          // keepAlive: true // 需要被缓存
        }
      },
      {
        path: '/active/specialSaleSuccess',
        name: 'specialSaleSuccess',
        desc: '特卖活动成功页',
        // component: _import('active/specialSaleSuccess'),
        component: () => import('@/views/active/specialSaleSuccess.vue'),

        meta:{
          title:'i我家',
          // keepAlive: true // 需要被缓存
        }
      },
      {
        path: '/active/giftBag',
        name: 'giftBag',
        desc: '大礼包活动',
        // component: _import('active/giftBag'),
        component: () => import('@/views/active/giftBag.vue'),

        meta:{
          title:'i我家',
          // keepAlive: true // 需要被缓存
        }
      },
      {
        path: '/active/giftBagSuccess',
        name: 'giftBagSuccess',
        desc: '大礼包活动',
        // component: _import('active/giftBagSuccess'),
        component: () => import('@/views/active/giftBagSuccess.vue'),

        meta:{
          title:'i我家',
          // keepAlive: true // 需要被缓存
        }
      },
      {
        path: '/active/submitOrder',
        name: 'submitOrder',
        desc: '活动下单',
        // component: _import('active/submitOrder'),
        component: () => import('@/views/active/submitOrder.vue'),

        meta:{
          title:'i我家',
          // keepAlive: true // 需要被缓存
        }
      },
      {
        path: '/active/travelInformation',
        name: 'travelInformation',
        desc: '用户信息',
        // component: _import('active/travelInformation'),
        component: () => import('@/views/active/travelInformation.vue'),

        meta:{
          title:'填写信息',
          // keepAlive: true // 需要被缓存
        }
      },
    ]
  },
  {
    path: '/order',
    component: baseLayout,
    children: [
      {
        path: '/order/orderList',
        name: 'orderList',
        desc: '我的订单',
        // component: _import('order/orderList'),
        component: () => import('@/views/order/orderList.vue'),

        meta:{
          title:'我的订单',
          keepAlive: true
        }
      },
      {
        path: '/order/orderDetail',
        name: 'orderDetail',
        desc: '订单详情',
        // component: _import('order/orderDetail'),
        component: () => import('@/views/order/orderDetail.vue'),

        meta:{
          title:'订单详情'
        }
      },
      {
        path: '/order/refund',
        name: 'refund',
        desc: '退款',
        // component: _import('order/refund'),
        component: () => import('@/views/order/refund.vue'),

        meta:{
          title:'退款'
        }
      },
    ]
  },
  {
    path: "/error",
    name: "error",
    // component: _import('error/error'),
    component: () => import('@/views/error/error.vue'),

    meta: { 
      title: '404'
     }
  },
  {
    path: '*',  // * 表示上面路径匹配不到的都显示这个页面
    name: '404',
    // component: _import('error/404'),
    component: () => import('@/views/error/404.vue'),

    meta: { 
      title: '404'
    }
  },
];


export default new VueRouter({
  // mode: 'hash',
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})
